import * as React from 'react';
import { DataGridPro } from '@mui/x-data-grid-pro';
import { DataGrid, GridColDef, GridValueGetterParams } from '@mui/x-data-grid';


export default function DataGridProDemo() {



  const columns: GridColDef[] = [
    { field: '№', headerName: '№', width: 90 },
    {
      field: 'orderName',
      headerName: 'Заказ',
      width: 150,
      editable: true,
    },
    {
      field: 'limitation',
      headerName: 'Сроком до',
      width: 150,
      editable: true,
    },
    {
      field: 'age',
      headerName: 'Age',
      type: 'number',
      width: 110,
      editable: true,
    },
    {
      field: 'fullName',
      headerName: 'Full name',
      description: 'This column has a value getter and is not sortable.',
      sortable: false,
      width: 160,
      valueGetter: (params: GridValueGetterParams) =>
        `${params.getValue(params.id, 'orderName') || ''} ${
          params.getValue(params.id, 'limitation') || ''
        }`,
    },
  ];

  const rows = [
    { id: 1, limitation: 'Snow', orderName: 'Jon', age: 35 },
    { id: 2, limitation: 'Lannister', orderName: 'Cersei', age: 42 },
    { id: 3, limitation: 'Lannister', orderName: 'Jaime', age: 45 },
    { id: 4, limitation: 'Stark', orderName: 'Arya', age: 16 },
    { id: 5, limitation: 'Targaryen', orderName: 'Daenerys', age: null },
    { id: 6, limitation: 'Melisandre', orderName: null, age: 150 },
    { id: 7, limitation: 'Clifford', orderName: 'Ferrara', age: 44 },
    { id: 8, limitation: 'Frances', orderName: 'Rossini', age: 36 },
    { id: 9, limitation: 'Roxie', orderName: 'Harvey', age: 65 },
  ];

  return (
    <div style={{ height: 520, width: '100%' }}>
      <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        checkboxSelection
        disableSelectionOnClick
      />
    </div>
  );
}
